script: |
  super -f text -I q9260.spq | sort > q9260.out

inputs:
  - name: q9260.spq
    data: |
      SELECT - 94 AS col2, 65 + + 4 + + ( + 78 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT IN ( + + 85 - + col0 * - col1 * - col2 * - col2, col2 );
  - name: tab1

outputs:
  - name: q9260.out
    data: |
